window.bookSummaryJSON = "<p>Falken Calder dreams of becoming immortal.</p> <p>But as a mere scullery boy in service of the fabled Ardent Lunar Sect, his chances of rising through the ranks are slim. There is only one way he can take up the title of cultivator - to awaken before he comes of age. Time is already running out.</p> <p>When a grand tournament for the magicking arts is announced, bringing old foes to Albion’s shores - rumours of betrayal and war send Falken on a journey in the unknown. There he unearths the mysteries of an ancient, long-forgotten sect - whose secrets offer hope - and the chance for Falken to develop powers that none have seen in an age.</p> <p>But Falken’s newfound powers may not be enough, for nightmare creatures, dark assassins and even the undead stalk the lands of Netherdei.</p> <p>And this is only the beginning....</p>"; 
